class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        ls = len(s)
        p = ''.join(sorted(p))
        lp = len(p)
        res = []
        for i in range(0, ls-lp+1):
            if ''.join(sorted(s[i:i+lp])) == p:
                res.append(i)
        return res

